import React from "react";
import gym1 from "./images/gym1.jpg";

const Firstpage = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md-10 mx-auto">
            <div className="row d-flex justify-content-lg-center align-items-center" >
              <div className="col-md-6 py-5 mt-5 ">
                <h1 className=" pt-lg-5 titleFirst">Join us to get Fit</h1>
                <h2 className="titleSecond">FITLINE</h2>
                <button type="button" class="btn btn-outline-primary btn-lg">
                  Register Now
                </button>
              </div>
              <div className="col-md-6 " style = {{border : "2px solid"}}>
                <img src={gym1} className="img-fluid imgFirst " />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Firstpage;
